    <style>
    html, body, table {

    h1, h2 , h3, h4, h5 {

        right: 40px;

        margin: 5px;

        background: #ddd;

            background: inherit;
        }

            color: transparent;

        margin-left: 15px;

        text-align: left;
        padding: 2px 6px 2px 6px;
    }

        font-weight: bold;
    }

        td, th {
            white-space: nowrap;
        }
    }

    .caption {
        text-align: center;
        font-size: 90%;
    }

    img {
        display: block;
        margin: auto;
        max-height: 20cm;

        width: 1em;
        height: 1em;
        margin-right: 6px;

    span.legend-item {
        margin-right: 24px;

    textarea {

        font-style: italic;
        width: 100%;
        height: 4em;
    }

    .textwrapper {
        padding: 15px;
    }

    div.normal textarea:invalid {
        display: none;
    }

    div.selected textarea {
        display: block;
    }

    @media print{
        section.section, img {
            page-break-inside: avoid;
        }
    }
    </style>
